import React from 'react';
import Button from "@material-ui/core/IconButton";
import Link from '@material-ui/core/Link';
import GitHubIcon from '@material-ui/icons/GitHub';
import TwitterIcon from '@material-ui/icons/Twitter';
import LinkedInIcon from '@material-ui/icons/LinkedIn';

const About = () => {
    return (
        <div className="container">
            <div className="py-4">
                <h1 className="heading">Developed and Designed by Rosita Sikarwar</h1>
            
                <div class= "col-lg-6 col-md-6" style={{ display: "center" }}>
                    <Link to="/hj">
                        <Button style={{ color: "black" }} onClick={() => window.open("https://github.com/Rositasikarwar", '_blank')}>
                            <GitHubIcon />
                        </Button>
                    </Link>
                    <Button style={{ color: "black" }} onClick={() => window.open("https://twitter.com/Rosita31563620", '_blank')}>
                        <TwitterIcon />
                    </Button>
                    <Button style={{ color: "black" }} onClick={() => window.open("https://www.linkedin.com/in/rosita-sikarwar/", '_blank')}>
                        <LinkedInIcon />
                    </Button>
                </div>
            </div>

        </div>
    );
};

export default About;
